package bean;

public class BroadCastingDonationVo {

	int don_serial;
	String don_mid;
	String don_oid;
	int don_price;
	String don_rdate;
	String don_push;
	String don_content;
	String url;
	int type;
	
	
	public BroadCastingDonationVo() {
		// TODO Auto-generated constructor stub
	}


	public int getDon_serial() {
		return don_serial;
	}


	public void setDon_serial(int don_serial) {
		this.don_serial = don_serial;
	}


	public String getDon_mid() {
		return don_mid;
	}


	public void setDon_mid(String don_mid) {
		this.don_mid = don_mid;
	}


	public String getDon_oid() {
		return don_oid;
	}


	public void setDon_oid(String don_oid) {
		this.don_oid = don_oid;
	}


	public int getDon_price() {
		return don_price;
	}


	public void setDon_price(int don_price) {
		this.don_price = don_price;
	}


	public String getDon_rdate() {
		return don_rdate;
	}


	public void setDon_rdate(String don_rdate) {
		this.don_rdate = don_rdate;
	}


	public String getDon_push() {
		return don_push;
	}


	public void setDon_push(String don_push) {
		this.don_push = don_push;
	}


	public String getDon_content() {
		return don_content;
	}


	public void setDon_content(String don_content) {
		this.don_content = don_content;
	}


	public String getUrl() {
		return url;
	}


	public void setUrl(String url) {
		this.url = url;
	}


	public int getType() {
		return type;
	}


	public void setType(int type) {
		this.type = type;
	}
	

	
}
